importScripts("/scripts/workbox-sw.min.js");workbox&&console.log("Workbox loaded successfully");workbox.routing.registerRoute(/\.(?:webp|png|jpg|jpeg|gif)$/,new workbox.strategies.CacheFirst({cacheName:"image-cache",plugins:[new workbox.expiration.Plugin({maxEntries:200,maxAgeSeconds:86400,purgeOnQuotaError:!0})]}));
self.addEventListener("fetch",function(a){/\.(?:webp|png|jpg|jpeg|gif)$/.test(a.request)?caches.open("image-cache").then(function(b){b.match(a.request).then(function(d){d||fetch(a.request).then(function(c){c.ok&&b.put(a.request,c.clone())})})}):caches.open("main-cache").then(function(b){b.match(a.request).then(function(d){d||fetch(a.request).then(function(c){c.ok&&b.put(a.request,c.clone())})})})});
